  //初始化状态
  state = {userList:[]}
  //存储搜索到的用户信息
  saveUserLsit =(users) =>{
    this.setState({userList:users});
  }
  render() {
    return (
        <div className="container">
          <Search saveUserLsit={this.saveUserLsit}/>
          <List/>
        </div>
    )
  }
}
